import teamPic from '../pics/teamPic.png';
import beet from '../pics/beet.png';
import mosquito from '../pics/mosq.jpg';

const Team = () => {
	const displayMosquitos = () => {
        const step = (2*Math.PI) / 7;
		const list = [];
        let angle = 0;
		for (let i = 1; i <= 7; i++) {
			list.push(
				<img
					key={i}
					className='w-1/5 absolute'
					style={{ top: Math.round(470/2 + 10 * Math.sin(angle)), left: Math.round(470/2 + 10 * Math.cos(angle))}}
					src={mosquito}
					alt='Mosquito'
				/>
			);
            angle += step;
		}

		return list;
	};

	return (
		<div>
			<h1 className='text-center text-6xl m-2'>Team Members</h1>
			<div className='mx-20'>
				<img className='w-full' src={teamPic} alt='Team' />
			</div>
			<div className='w-1/2 mx-auto my-60 relative'>
				<img className='w-full h-full' src={beet} alt='Beetroot' />
				{displayMosquitos()}
			</div>
		</div>
	);
};

export default Team;
